import React from 'react';
import SignupForm from '../components/SignupForm/SignupForm';
const SignUp = () => {
    return (
        <div className="mainContainerSignup">
        <img src="signup.svg" alt="" />
            <SignupForm/>
        </div>
    );
};

export default SignUp;
